engine/.body:
VTL Engine
Dependency

    fr.insee.trevas
    vtl-engine
    0.1.0


Instanciation of the execution engine
The execution engine conforms to the Script Engine specification, and can thus be instanciated with the following instuction:
ScriptEngine engine = new ScriptEngineManager().getEngineByName("vtl");

Input variables
Input variables can be declared to the engine by passing them in key/value form in a Bindings object.
Bindings bindings = new SimpleBindings(Map.of("a", 1));
ScriptContext context = engine.getContext();
context.setBindings(bindings, ScriptContext.ENGINE_SCOPE);

Script execution
// The 'a' will be looked up in the engine bindings
String script = "res := a + 1;";
try {
    engine.eval(script);
} catch (ScriptException e) {
    e.printStackTrace();
}

Retrieving the results
All the input and output variables are accessible via the engine context:
Bindings outputBindings = engine.getContext().getBindings(ScriptContext.ENGINE_SCOPE);

It is then possible to access a particular variable:
outputBindings.get("res");

Dataset
The data sets are represented as instances of Dataset.
These Dataset are composed of a dataStructure and a dataPoints members.
The dataStructure are composed of Component members, each having a name, a role and a type.
The values in the dataPoints of components that have a IDENTIFIER role must be unique.
Two subclasses of Dataset are exposed:

InMemoryDataset: allows the creation of a Dataset within the JVM (see details)
SparkDataset: allows the creation of a Dataset to be transferred to Spark (see details)

engine/in-memory.html.body:
Dataset - InMemory
The InMemoryDataset datasets represent statistical cubes in a Java application.
Exemple
ScriptEngine engine = new ScriptEngineManager().getEngineByName("vtl");

Bindings bindings = new SimpleBindings();

// By default, if a variable role is not defined, the `MEASURE` will be affected.
InMemoryDataset dataset = new InMemoryDataset(
                List.of(
                        Map.of("var1", "x", "var2", "y", "var3", 5),
                        Map.of("var1", "xx", "var2", "yy", "var3", 10)
                ),
                Map.of("var1", String.class, "var2", String.class, "var3", Long.class),
                Map.of()
);

bindings.put("dataset", dataset);

ScriptContext context = engine.getContext();
context.setBindings(bindings, ScriptContext.ENGINE_SCOPE);

String script = "res := dataset[filter var3 > 6];";

try {
    engine.eval(script);
} catch (ScriptException e) {
    e.printStackTrace();
}

Bindings outputBindings = engine.getContext().getBindings(ScriptContext.ENGINE_SCOPE);

InMemoryDataset res = (InMemoryDataset) outputBindings.get("res");

engine/spark.html.body:
Dataset - Spark
The SparkDataset represent statistical cubes in Java, and delegate computations to a Spark cluster.
Usage

add required Trevas / Spark dependencies
instanciate a Spark session
instanciate a Trevas / Spark engine
create the Spark data sources and feed them to the Trevas engine as SparkDataset instances

Dependencies

    fr.insee.trevas
    vtl-engine
    0.1.0


    fr.insee.trevas
    vtl-spark
    0.1.0



    org.apache.spark
    spark-kubernetes_2.12
    3.0.1


Spark session
Local
SparkSession.Builder sparkBuilder = SparkSession.builder()
        .appName("my-app")
        .master("local");

SparkSession spark = sparkBuilder.getOrCreate();

Standalone
Install a standalone Spark cluster
The Spark cluster can be installed in any environment.
For example, installing a Spark cluster in a Kubernetes cluster via Helm is done with:
helm install my-spark bitnami/spark --set image.repository=inseefrlab/spark --set image.tag=latest

Instanciate the Spark session
SparkSession.Builder sparkBuilder = SparkSession.builder()
        .appName("vtl-lab")
        // my-spark is the name previously given to the cluster
        .master("spark://my-spark-master-svc:7077");

// Activate dynamic allocation of executors (optional)
sparkBuilder.config("spark.dynamicAllocation.enabled", true);
sparkBuilder.config("spark.dynamicAllocation.shuffleTracking.enabled", true);
// Minimum number of executors
sparkBuilder.config("spark.dynamicAllocation.minExecutors", 10);

// Connection to a S3 HDFS datalake
sparkBuilder.config("spark.hadoop.fs.s3a.access.key", sparkProperties.getAccessKey());
sparkBuilder.config("spark.hadoop.fs.s3a.secret.key", sparkProperties.getSecretKey());
sparkBuilder.config("spark.hadoop.fs.s3a.connection.ssl.enabled", sparkProperties.getSslEnabled());
sparkBuilder.config("spark.hadoop.fs.s3a.session.token", sparkProperties.getSessionToken());
sparkBuilder.config("spark.hadoop.fs.s3a.endpoint", sparkProperties.getSessionEndpoint());

// Transfer Spark dependencies to the Spark executors
// See https://stackoverflow.com/questions/28079307
sparkBuilder.config("spark.jars", String.join(",",
        "/vtl-spark.jar",
        "/vtl-model.jar",
        "/vtl-jackson.jar",
        "/vtl-parser.jar",
        "/vtl-engine.jar"
));

SparkSession spark = sparkBuilder.getOrCreate();

Kubernetes
Instead of connecting to a previously installed Spark instance (standalone mode), Kubernetes allows the orchestration of the execution of a Spark job in the cluster.
Service account
A service account must be configured to allow the client application that queries the Kubernetes cluster to obtain the rights required to launch the job:

serviceaccount.yml

Declare the service account associated to a Kubernetes cluster:
apiVersion: v1
kind: ServiceAccount
metadata:
  name: my-service-account
  namespace: my-namespace


role.yml

Declare the roles associated to a Kubernetes namespace:
apiVersion: rbac.authorization.k8s.io/v1
kind: Role
metadata:
  name: my-role
  namespace: my-namespace
rules:
  - apiGroups:
      - ""
    resources:
      - "pods"
      - "services"
      - "configmaps"
    verbs:
      - "list"
      - "create"
      - "delete"
      - "watch"
      - "update"
      - "get"
      - "patch"


role-bindings.yml

Associate the service account and the role in the Kubernetes namespace:
apiVersion: rbac.authorization.k8s.io/v1
kind: RoleBinding
metadata:
  name: my-role-bindings
subjects:
  - kind: ServiceAccount
    name: my-service-account
    namespace: my-namespace
roleRef:
  kind: Role
  name: my-role
  apiGroup: rbac.authorization.k8s.io


deployment.yml

Define the service account to use in the client Java application:
[...]
spec:
  template:
    spec:
      serviceAccountName: vtl-lab-sa
[...]

Configuration of the Spark Kubernetes session
SparkSession.Builder sparkBuilder = SparkSession.builder()
                .appName("my-app")
                .master("k8s://https://kubernetes.default.svc.cluster.local:443");

// Docker image deployed for the driver and the executors
sparkBuilder.config("spark.kubernetes.container.image.pullPolicy", sparkProperties.getKubernetesContainerImagePullPolicy());
sparkBuilder.config("spark.kubernetes.container.image", sparkProperties.getKubernetesContainerImage());

// Configuration of the Spark instance to deploy in the Kubernetes cluster
sparkBuilder.config("spark.kubernetes.namespace", sparkProperties.getKubernetesNamespace());
sparkBuilder.config("spark.kubernetes.executor.request.cores", sparkProperties.getKubernetesExecutorRequestCores());
sparkBuilder.config("spark.kubernetes.driver.pod.name", sparkProperties.getKubernetesDriverPodName());

// Activate the dynamic allocation of executors (optional)
sparkBuilder.config("spark.dynamicAllocation.enabled", true);
sparkBuilder.config("spark.dynamicAllocation.shuffleTracking.enabled", true);
// Minimum number of executors
sparkBuilder.config("spark.dynamicAllocation.minExecutors", 10);

// Connection to a type 3 HDFS datalake
sparkBuilder.config("spark.hadoop.fs.s3a.access.key", sparkProperties.getAccessKey());
sparkBuilder.config("spark.hadoop.fs.s3a.secret.key", sparkProperties.getSecretKey());
sparkBuilder.config("spark.hadoop.fs.s3a.connection.ssl.enabled", sparkProperties.getSslEnabled());
sparkBuilder.config("spark.hadoop.fs.s3a.session.token", sparkProperties.getSessionToken());
sparkBuilder.config("spark.hadoop.fs.s3a.endpoint", sparkProperties.getSessionEndpoint());

// Transfer the Trevas dependencies to the Spark executors
// See https://stackoverflow.com/questions/28079307
sparkBuilder.config("spark.jars", String.join(",",
        "/vtl-spark.jar",
        "/vtl-model.jar",
        "/vtl-jackson.jar",
        "/vtl-parser.jar",
        "/vtl-engine.jar"
));

SparkSession spark = sparkBuilder.getOrCreate();

Trevas / Spark execution engine
By defaults, a Trevas engine resolves treatments InMemory.
In order to activate the resolution via Spark, two properties must be valued:
ScriptEngine engine = new ScriptEngineManager().getEngineByName("vtl");
ScriptContext context = engine.getContext();
context.setBindings(bindings, ScriptContext.ENGINE_SCOPE);
engine.put("$vtl.engine.processing_engine_names", "spark");
engine.put("$vtl.spark.session", spark);

SparkDataset
In order to instanciate a Trevas SparkDataset, a Spark data source and a JSON file describing the data structure are required.
Spark data source
The Spark API allows the creation of Dataset instances from various formats : Parquet, Avro, JSON, CSV, JDBC...
Parquet
Dataset dataset = spark.read().parquet("path/to/parquet/folder");

Data structure
Format
[
  { "name": "id", "type": "STRING", "role": "IDENTIFIER" },
  { "name": "x", "type": "INTEGER", "role": "MEASURE" },
  { "name": "y", "type": "FLOAT", "role": "MEASURE" }
]

Serialization
List components =
objectMapper.readValue(Paths.get("path/to/structure.json")
                .toFile(),
        new TypeReference<>() {
        });
Structured.DataStructure structure = new Structured.DataStructure(components);

SparkDataset instanciation
SparkDataset dataset = new SparkDataset(dataset, structure);

usage.html.body:
Usage
Importing into a Maven project
The Trevas engine has to be added to your project via the pom.xml:

    fr.insee.trevas
    vtl-engine
    x.y.z


Engine usage
To instantiate the VTL 2.0 engine, we simply have to create a ScriptEngine:
ScriptEngine engine = new ScriptEngineManager().getEngineByName("vtl");

If we want to add input bindings, we can do it as follows:
ScriptContext context = engine.getContext();
context.setBindings(jsonBindings, ScriptContext.ENGINE_SCOPE);

To execute the script and get results, just do:
try {
    engine.eval(script);
    Bindings outputBindings = context.getBindings(ScriptContext.ENGINE_SCOPE);
    response.send(outputBindings);
} catch (ScriptException e) {
    processErrors(e, request, response);
}

Where processErrors can be for instance:
private  T processErrors(Throwable ex, ServerRequest request, ServerResponse response) {
    LOGGER.log(Level.FINE, "Error", ex);
    if (ex instanceof VtlScriptException) {
        JsonObject jsonErrorObject = JSON.createObjectBuilder()
                .add("error", ex.getMessage())
                .build();
        response.status(Http.Status.BAD_REQUEST_400).send(jsonErrorObject);
    }

    JsonObject jsonErrorObject = JSON.createObjectBuilder()
            .add("error", ex.getMessage())
            .build();
    response.status(Http.Status.INTERNAL_SERVER_ERROR_500).send(jsonErrorObject);

    return null;
}

Dataset serialization
Instead of dealing yourself with Dataset objects defined in the Trevas Model module, a dedicated module based on Jackson is available in Trevas.
Dependencies

    fr.insee.trevas
    vtl-jackson
    x.y.z
    compile


    com.fasterxml.jackson.core
    jackson-databind
    2.11.2


Initialization of Jackson Mapper
Thanks to the module, it's possible to register once the Trevas Jackson module in your application:
ObjectMapper mapper = new ObjectMapper();
mapper.registerModule(new TrevasModule());

Providing it to your webserver, Dataset, Component and Bindings will be serialized/deserialized automatically.
Bindings JSON model
The JSON bindings cover scalars and datasets.
To include a Dataset, you have to respect the following model:
{
    "dataStructure": [
        {"name": "my_name", "type": "STRING", "role": "IDENTIFIER"},
        {"age": "my_age", "type": "INTEGER", "role": "MEASURE"},
    ],
    "dataPoints": [
        ["name1", 20],
        ["name2", 30],
        ...
    ]
}

The value of type has to be one of: STRING, INTEGER, NUMBER, BOOLEAN.
The value of role has to to be one of: IDENTIFIER, MEASURE, ATTRIBUTE.
